import './App.css';
import styled from 'styled-components';
import {useState} from 'react';

function App() {
  const [colors, setColors] = useState({  });

  const submitColors = (e) => {
    e.preventDefault();
  }

  return (
    <div className="App">
      <header className="App-header">
        <Title>
          Jordan Moore
        </Title>
        <ColorForm>
          <h3>Dark: </h3>
          <input type="text" name="dark" value={colors.dark}/>
          <h3>Darker: </h3>
          <input type="text" name="darker" value={colors.darker}/>
          <h3>Light: </h3>
          <input type="text" name="light" value={colors.light}/>
          <h3>Lighter: </h3>
          <input type="text" name="lighter" value={colors.lighter}/>
          <button onClick={(e) => submitColors(e)}>Change Colors!</button>
        </ColorForm>
      </header>
    </div>
  );
}

export default App;

const Title = styled.div`
  padding: 1em;
  display: flex;
  color: var(--light2);
  font-size: 500%;
  letter-spacing: normal;
  transition: all 1s;

  :hover {
    letter-spacing: .05em;
  }
`;

const ColorForm = styled.div`
  color: var(--light1);
  display: flex;
  flex-flow: wrap column;
  align-items: flex-start;

  button{
    margin: 2em 0;
  }
`;
